INSERT INTO `statistics_tournaments` (`tournament_id`, `name`, `date`, `date_to`, `location`, `allowed_reg_categories`, `capacity`, `nmbr_of_round`, `nmbr_of_fnl_laps`, `about`, `photo`, `thumb`, `allow_registration`, `lat`, `lng`, `max_open`, `max_women`, `slovak_champ`, `dir_name`, `dir_email`, `dir_phone`) VALUES (9, '2014 Budmerice Spring Fling', '2014-04-26', '2014-04-27', 'Budmerice', ';OPEN;OPEN Junior;OPEN Master;WOMEN;WOMEN Junior;WOMEN Master', 56, 5, 1, '<p>&nbsp;</p>\n<table>\n<tbody>\n<tr>\n<td>\n<h3>KDE</h3>\n</td>\n<td>\n<h3>WHERE</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>V parku okolo Budmerick&eacute;ho ka&scaron;tieľa</p>\n</td>\n<td>\n<p>Park of Budmerice Castle</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>DIV&Iacute;ZIE</h3>\n</td>\n<td>\n<h3>DIVISIONS</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>OPEN, WOMEN, OPEN JUNIOR, WOMEN JUNIOR, OPEN MASTER, WOMEN MASTER</p>\n</td>\n<td>\n<p>OPEN, WOMEN, OPEN JUNIOR, WOMEN JUNIOR, OPEN MASTER, WOMEN MASTER</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>IHRISKO / FORM&Aacute;T</h3>\n</td>\n<td>\n<h3>COURSE / FORMAT</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>5 x 14 jamiek + 6 jamiek fin&aacute;le (najlep&scaron;&iacute;ch 5 OPEN, najlep&scaron;ie 4 WOMEN)</p>\n</td>\n<td>\n<p>5 x 14 holes + 6 holes final (best 5 OPEN, best 4 WOMEN)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Ihrisko sa nach&aacute;dza v kr&aacute;snom z&aacute;mockom parku, rovn&yacute; ter&eacute;n, technick&eacute; jamky s často dobre kryt&yacute;mi ko&scaron;mi.</p>\n</td>\n<td>\n<p>The course is set in a beautiful castle park, flat terrain, technical holes with often well guarded baskets</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>PROGRAM TURNAJA</h3>\n</td>\n<td>\n<h3>TOURNAMENT SCHEDULE</h3>\n</td>\n</tr>\n<tr>\n<td>\n<h4>Sobota 26.apr&iacute;la 2014</h4>\n</td>\n<td>\n<h4>Saturday April 26, 2014</h4>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:00 registr&aacute;cia hr&aacute;čov</p>\n</td>\n<td>\n<p>09:00 registration</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:20 stretnutie hr&aacute;čov</p>\n</td>\n<td>\n<p>09:20 player&rsquo;s meeting</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:45 prv&eacute; kolo (14 jamiek)</p>\n</td>\n<td>\n<p>09:45 1<sup>st</sup> round (14 holes)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>11:15 kr&aacute;tka prest&aacute;vka</p>\n</td>\n<td>\n<p>11:15 short break</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>11:30 druh&eacute; kolo (14 jamiek)</p>\n</td>\n<td>\n<p>11:30 2<sup>nd</sup> round (14 holes)</p>\n</td>\n</tr>\n<tr>\n<td>13:15 obedn&aacute; prest&aacute;vka</td>\n<td>13:15 lunch break</td>\n</tr>\n<tr>\n<td>\n<p>15:00 stretnutie hr&aacute;čov</p>\n</td>\n<td>\n<p>15:00 player&rsquo;s meeting</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>15:15 tretie kolo (14 jamiek)</p>\n</td>\n<td>\n<p>15:00 3<sup>rd</sup> round (14 holes)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>17:00 s&uacute;ťaž v puttingu</p>\n</td>\n<td>\n<p>17:00 putting contest</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h4>Nedeľa 27.apr&iacute;la 2014</h4>\n</td>\n<td>\n<h4>Sunday April 27, 2014</h4>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:30 stretnutie hr&aacute;čov</p>\n</td>\n<td>\n<p>09:30 player&rsquo;s meeting</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:50 &scaron;tvrt&eacute; a piate kolo (2 x 14 jamiek)</p>\n</td>\n<td>\n<p>09:50 4<sup>th</sup> and 5<sup>th</sup> round (2 x 14 holes)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>13:00 prest&aacute;vka</p>\n</td>\n<td>\n<p>13:00 short break</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>13:30 fin&aacute;le (6 jamiek, najlep&scaron;&iacute;ch 5 OPEN a 4 WOMEN)</p>\n</td>\n<td>\n<p>13:30 final (6 holes, best 5 OPEN, best 4 WOMEN)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>15:00 vyhodnotenie</p>\n</td>\n<td>\n<p>15:00 awards ceremony</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>REGISTR&Aacute;CIA</h3>\n</td>\n<td>\n<h3>REGISTRATION</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Na tejto str&aacute;nke do 25.4.2014, pr&iacute;padne ak to umožn&iacute; turnajov&aacute; kapacita aj priamo na turnaji počas registr&aacute;cie</p>\n</td>\n<td>\n<p>On this website until April 25, 2014 or, if the tournament capacity allows, directly at the tournament registration booth.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>REGISTRAČN&Yacute; POPLATOK</h3>\n</td>\n<td>\n<h3>REGISTRATION FEE</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>8 &euro; na hr&aacute;ča</p>\n</td>\n<td>\n<p>8 &euro; per player</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>2 &euro; zľava pre členov Slovenskej asoci&aacute;cie Frisbee</p>\n</td>\n<td>\n<p>2 &euro; discount for members of Slovak Association of Frisbee</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Poplatok sa plat&iacute; pri registr&aacute;cii priamo na turnaji.</p>\n</td>\n<td>\n<p>The registration fee is due at the tournament registration booth.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>JEDLO</h3>\n</td>\n<td>\n<h3>FOOD</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Voda a mal&eacute; občertvenie s&uacute; zahrnut&eacute; v turnajovom poplatku. V obci je viacero možnost&iacute; na obed a večeru v sobotu a nedeľu s cenami od 5&euro;. Odpor&uacute;čan&aacute; re&scaron;taur&aacute;cia je <a href="https://plus.google.com/103123951796227980920/about?hl=sk">Re&scaron;taur&aacute;cia KVAK</a> , <a href="http://kvakrestaurant.webnode.sk/kontakt/">alternat&aacute;vny link</a> (otvoren&eacute; sobota 12:00 - 24:00 a nedeľa 12:00 - 22:00).</p>\n</td>\n<td>\n<p>Water and small snack are included in the player fee. Multiple lunch and dinner options in the village are available on Saturday and Sunday starting at 5&euro;, recommended option <a href="https://plus.google.com/103123951796227980920/about?hl=sk">Restaurant KVAK</a> , <a href="http://kvakrestaurant.webnode.sk/kontakt/">alternative link </a>(open Saturday 12:00 - 24:00 and Sunday 12:00 - 22:00). Lunch orders will be taken on Saturdaz during the on-site registration.&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Na v&yacute;ber na obed v sobotu pri registr&aacute;cii bud&uacute; dve možnosti v KVAKu:</p>\n</td>\n<td>\n<p>During the on-site registration on Saturday you can preorder your lunch option:</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>(A) Bravčov&yacute; rezeň</p>\n</td>\n<td>\n<p>(A) Pork schnitzel</p>\n</td>\n</tr>\n<tr>\n<td>(B) Zapekan&aacute; zelenina so zemiakmi a syrom</td>\n<td>(B) Vegatable casseroll with potatos and cheese (vegetarian)</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<h3>UBYTOVANIE</h3>\n</td>\n<td>\n<h3>ACCOMMODATION</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>UNISTAV, Jablonecka 2, Budmerice, 48.353536,17.416451&nbsp; <a href="https://maps.google.sk/maps?q=48.353606,17.416395&amp;hl=sk&amp;num=1&amp;t=h&amp;z=19">Mapa</a>, v žltom kruhu na mape on this page</p>\n<p><span style="color: #ff0000;">Ak m&aacute;te z&aacute;ujem o ubytovanie aj z piatku na sobotu, uveďte to pri registr&aacute;cii do pozn&aacute;mky.</span></p>\n</td>\n<td>\n<p>UNISTAV, Jablonecka 2, Budmerice, 48.353536,17.416451&nbsp; <a href="https://maps.google.sk/maps?q=48.353606,17.416395&amp;hl=sk&amp;num=1&amp;t=h&amp;z=19">Map</a>, see also yellow circle on the map on this page</p>\n<p><span style="color: #ff0000;">If you are interested in accommodation on Friday night, indicate it in the note at the registration.</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>robotn&iacute;cka ubytovňa 6&euro; za osobu a noc</p>\n</td>\n<td>\n<p>basic accommodation 6&euro; per night per person (double room)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>hotelov&aacute; časť 12&euro; za osobu a noc</p>\n</td>\n<td>\n<p>hotel accommodation 12&euro; per night per person (double room)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>možnosť raňajok na nedeľu cca. 3&euro;</p>\n</td>\n<td>\n<p>optional breakfast on Sunday approx. 3&euro;</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>TURNAJOV&Aacute; KOMISIA</h3>\n</td>\n<td>\n<h3>TOURNAMENTS ORGANIZERS</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Riaditeľ turnaja: Martin Krička</p>\n</td>\n<td>\n<p>Tournament director: Martin Krička</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>S&uacute;ťažn&aacute; komisia: Richard Koll&aacute;r, Stefan Dobrev</p>\n</td>\n<td>\n<p>Sport Commission: Richard Koll&aacute;r, Stefan Dobrev</p>\n</td>\n</tr>\n</tbody>\n</table>\n<h3>&nbsp;ACCESS MAP</h3>\n<div style="display: inline; margin: 5px 10px 0px 0px; float: left;"><a href="https://sites.google.com/site/regnadgtur/budmerice-2013/BUD13.png?attredirects=0"><img src="https://sites.google.com/site/regnadgtur/_/rsrc/1367567440933/budmerice-2013/BUD13.png?height=262&amp;width=400" alt="" width="400" height="262" border="0" /></a></div>\n<h3><span style="font-family: arial,sans-serif;"><span style="font-size: medium;"><span style="font-size: small;"><span style="font-family: arial,sans-serif;"><span style="font-size: medium;"><span style="font-size: small;"><br /><span style="color: #4c1130;"><a href="https://sites.google.com/site/regnadgtur/goog_781703377"><br /></a></span></span></span></span></span></span></span><br /><span style="font-family: arial,sans-serif;"><strong><span style="font-size: medium;"><span style="text-decoration: underline;"><br /></span></span></strong></span></h3>\n<div style="display: inline; margin: 5px 10px; float: right;">&nbsp;</div>\n<h3><br /><br /><span style="font-family: arial,sans-serif;"><strong><span style="font-size: medium;"><span style="text-decoration: underline;"><span style="font-family: arial,sans-serif;"><strong><span style="font-size: medium;"><span style="text-decoration: underline;"><br /></span></span></strong></span><br /></span></span></strong></span><span style="font-family: arial,sans-serif;"><br /></span></h3>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<h3>COURSE MAP</h3>\n<p><img class="decoded shrinkToFit" src="https://36686afd-a-62cb3a1a-s-sites.googlegroups.com/site/regnadgtur/hidden/budmerice2014.JPG?attachauth=ANoY7crLdZTulPPSZp9eWHq2qzCAuMGU_oWcG-eliIAck_t_PymsCNyknC2zecmJfAVxlwWjr0PUh0S4t7n_g95HGSQ0fAqXcFE30Qzos2QBX7ar2_AIFvqNzdry1Qt9bsDwLW5XNqEaKsDHTs71sZ3DxU5Kb9eSilUghFuUx_PJwChUDtZKqURTvuV9wuMv1GpH5rV8VBCu6umgl8X_-3OCXWJ0jdNOC6pBluvDJ74sJsGZDbIB50I%3D&amp;attredirects=0" alt="https://36686afd-a-62cb3a1a-s-sites.googlegroups.com/site/regnadgtur/hidden/budmerice2014.JPG?attachauth=ANoY7crLdZTulPPSZp9eWHq2qzCAuMGU_oWcG-eliIAck_t_PymsCNyknC2zecmJfAVxlwWjr0PUh0S4t7n_g95HGSQ0fAqXcFE30Qzos2QBX7ar2_AIFvqNzdry1Qt9bsDwLW5XNqEaKsDHTs71sZ3DxU5Kb9eSilUghFuUx_PJwChUDtZKqURTvuV9wuMv1GpH5rV8VBCu6umgl8X_-3OCXWJ0jdNOC6pBluvDJ74sJsGZDbIB50I%3D&amp;attredirects=0" width="514" height="351" /></p>', '2958a2b0532fb97828d5e9f2880202a5.JPG', '2958a2b0532fb97828d5e9f2880202a5_thumb.JPG', 1, 48.363072, 17.395986, 100, 100, 0, 'Martin Krička', 'cirsson@gmail.com', '00421905805204'),
(10, '2013 Budmerice OPEN', '2013-04-20', '2013-04-21', 'Budmerice', NULL, 60, 6, 1, '<p>Budmerice OPEN 2013</p>\n<p>&nbsp;</p>', 'f6427ce1d6cd62be1c70a363dbb7d5a2.jpg', 'f6427ce1d6cd62be1c70a363dbb7d5a2_thumb.jpg', 0, NULL, NULL, 100, 100, 0, 'Lukáš Grožaj', 'kasho30@gmail.com', '09000000'),
(20, '2013 Stopfa Cup', '2013-03-23', '2013-03-23', 'Stupava', NULL, 50, 2, 1, '<p>Stompfa Cup 2013</p>', '90fb6dab3773d2a687f2e4b01b0b45d8.jpg', '90fb6dab3773d2a687f2e4b01b0b45d8_thumb.jpg', 0, NULL, NULL, 50, 50, 0, 'Martin Krička', 'cirsson@gmail.com', '09000000'),
(21, '2014 Smolenice OPEN', '2014-06-07', '2014-06-08', 'Smolenice', ';OPEN;OPEN Junior;OPEN Master;WOMEN;WOMEN Junior;WOMEN Master', 72, 3, 1, '<p>&nbsp;</p>\n<table>\n<tbody>\n<tr>\n<td>\n<h3>V&Scaron;EOBECN&Eacute; INFORM&Aacute;CIE</h3>\n</td>\n<td>\n<h3>GENERAL INFO</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Turnaj prebehne v okol&iacute; Smolenick&eacute;ho z&aacute;mku na jednom z najkraj&scaron;&iacute;ch discgolfov&yacute;ch ihr&iacute;sk Eur&oacute;py, dlh&eacute; otvoren&eacute; fairwaye, tesn&eacute; jamky v lese, rybn&iacute;k.</p>\n</td>\n<td>\n<p>The tournament is set in the Smolenice Castle Park at one of the most scenic discgolf courses in Europe with both long open and tight fairways in woods and with a famous hole across a pond.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Ubytovanie v noci zo soboty na nedeľu priamo na majest&aacute;tnom Smolenickom z&aacute;mku.</p>\n</td>\n<td>\n<p>Possible accommodation on Saturday night directly at the magnificent Smolenice castle.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Turnaj je orgazovan&yacute; ako PDGA C kateg&oacute;ria a z&aacute;roveň sl&uacute;ži ako Otvoren&eacute; majstrovstv&aacute; Slovenska 2014.</p>\n</td>\n<td>\n<p>The tournament is sanctioned as PDGA C and also serves as Open Slovak Championships 2014.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>DIV&Iacute;ZIE</h3>\n</td>\n<td>\n<h3>DIVISIONS</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>OPEN (MPO), WOMEN (FPO), JUNIOR (MJ1, FJ1), MASTER (MPM, FPM).</p>\n</td>\n<td>\n<p>OPEN (MPO), WOMEN (FPO), JUNIOR (MJ1, FJ1), MASTER (MPM, FPM)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Kateg&oacute;rie MJ1, FJ1, MPM a FPM sa otvoria len ak bud&uacute; aspoň &scaron;tyria prihl&aacute;sen&iacute; &uacute;častn&iacute;ci.V pr&iacute;pade neotvorenia kateg&oacute;rie bud&uacute; prihl&aacute;sen&iacute; hr&aacute;či automaticky preraden&iacute; do MPO a FPO.</p>\n</td>\n<td>\n<p>A minimum of four players is necessary in divisions MJ1, FJ1, MPM and FPM. In the case less players will register in one of the divisions, players will be autmatically put in MPO or FPO division.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Turnaj bude v roku 2014 z&aacute;roveň sl&uacute;žiť ako otvoren&eacute; majstrovstv&aacute; Slovenska v div&iacute;ziach OPEN, WOMEN, JUNIOR, MASTER a Nov&aacute;čik (kateg&oacute;ria pre nov&yacute;ch slovensk&yacute;ch hr&aacute;čov, ktor&iacute; nehrali na DG turnajoch organizovan&yacute;ch SAF pred rokom 2014).</p>\n</td>\n<td>\n<p>The tournament will also serve as 2014 Open Slovak Championships in divisions MPO, FPO, MJ1, FJ1, and a special category NOVICE for new Slovak players.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>IHRISKO / FORM&Aacute;T</h3>\n</td>\n<td>\n<h3>COURSE / FORMAT</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>3 x 18 jamiek + 6 jamiek fin&aacute;le (najlep&scaron;&iacute;ch 5 MPO, 4 FPO, 4 MPM)</p>\n</td>\n<td>\n<p>3 x 18 holes + 6 holes final (best 5 MPO, 4 FPO, 4 MPM)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>18 jamiek v parkovom prostred&iacute; (dĺžka 2376 m), zmie&scaron;an&yacute; les a l&uacute;ky, jedna jamka ponad jazero. 9 jamiek par 3, 7 jamiek par 4, 2 jamky par 5, spolu par 65.</p>\n</td>\n<td>\n<p>18 holes in the park&nbsp; (total length 2376 m), mixed forest and meadows, one hole over a pond. Total 9 holes par 3, 7 holes par 4, 2 holes par 5, total par per round 65.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><span style="color: #ff6600;"><strong>Fin&aacute;le:</strong></span> 6 jamiek, spolu 1265m, par 25.</p>\n</td>\n<td>\n<p><span style="color: #ff6600;"><strong>Final:</strong></span> 6 holes, total length 1265 m, par 25.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>PROGRAM TURNAJA</h3>\n</td>\n<td>\n<h3>TOURNAMENT SCHEDULE</h3>\n</td>\n</tr>\n<tr>\n<td>\n<h5>Piatok 6.j&uacute;na 2014</h5>\n</td>\n<td>\n<h5>Friday June 6, 2014</h5>\n</td>\n</tr>\n<tr>\n<td>\n<p>16:00 Odhodisk&aacute; označen&eacute;, miesto ko&scaron;a označen&eacute;, ihrisko pripraven&eacute; na tr&eacute;ning s vlastn&yacute;m prenosn&yacute;m ko&scaron;om</p>\n</td>\n<td>\n<p>16:00 teepads set up, location of discatchers marked, the course ready for a practice with your own portable basket</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h5>Sobota 7.j&uacute;na 2014</h5>\n</td>\n<td>\n<h5>Saturday June 7, 2014</h5>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:00 registr&aacute;cia hr&aacute;čov</p>\n</td>\n<td>\n<p>09:00 registration</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:30 stretnutie hr&aacute;čov</p>\n</td>\n<td>\n<p>09:30 player&rsquo;s meeting</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:50 prv&eacute; kolo</p>\n</td>\n<td>\n<p>09:50 1<sup>st</sup> round</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>13:00 obedn&aacute; prest&aacute;vka</p>\n</td>\n<td>\n<p>13:00 lunch break</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>14:45 stretnutie hr&aacute;čov</p>\n</td>\n<td>\n<p>14:45 player&rsquo;s meeting</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>15:00 druh&eacute; kolo</p>\n</td>\n<td>\n<p>15:00 2<sup>nd</sup> round</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>18:30 s&uacute;ťaž v puttingu</p>\n</td>\n<td>\n<p>18:30 putting contest</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h5>Nedeľa 8.j&uacute;na 2014</h5>\n</td>\n<td>\n<h5>Sunday June 8, 2014</h5>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:00 stretnutie hr&aacute;čov</p>\n</td>\n<td>\n<p>09:00 player&rsquo;s meeting</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:15 tretie kolo</p>\n</td>\n<td>\n<p>09:15 3<sup>th</sup> round</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>12:15 prest&aacute;vka</p>\n</td>\n<td>\n<p>12:15 short break</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>12:40 fin&aacute;le</p>\n</td>\n<td>\n<p>12:40 final round</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>15:00 vyhodnotenie</p>\n</td>\n<td>\n<p>15:00 awards ceremony</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>REGISTR&Aacute;CIA</h3>\n</td>\n<td>\n<h3>REGISTRATION</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Registr&aacute;cia na tejto str&aacute;nke bude otvoren&aacute; 9.4.2014 o 14:00 a bude trvať do na tejto str&aacute;nke do 4.6.2014, pr&iacute;padne ak to umožn&iacute; turnajov&aacute; kapacita aj priamo na turnaji počas registr&aacute;cie</p>\n</td>\n<td>\n<p>Registration on this website will be open on April 9 at 2pm and will close on June 4, 2014. If the tournament capacity allows, it will be possible to register also directly at the tournament registration booth.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>REGISTRAČN&Yacute; POPLATOK</h3>\n</td>\n<td>\n<h3>REGISTRATION FEE</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>20 &euro; včasn&yacute; registračn&yacute; poplatok (zaplaten&yacute; do 31.m&aacute;ja 2014)</p>\n</td>\n<td>\n<p>20 &euro; advanced registration fee (paid by May 31, 2014)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>2 &euro; zľava pre členov Slovenskej asoci&aacute;cie Frisbee alebo akt&iacute;vnych členov PDGA</p>\n</td>\n<td>\n<p>2 &euro; discount for members of Slovak Association of Frisbee or active PDGA members</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>22 &euro; neskor&yacute; registračn&yacute; poplatok (zaplaten&yacute; 1.j&uacute;na 2014 alebo nesk&ocirc;r)</p>\n</td>\n<td>\n<p>22 &euro; late registration fee (paid on or after June 1, 2014)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Poplatok sa plat&iacute; bankov&yacute;m prevodom. V pr&iacute;pade neskorej registr&aacute;cie je možn&eacute; zaplatiť neskor&yacute; registračn&yacute; poplatok aj na mieste turnaja v hotovosti pri registr&aacute;cii.</p>\n</td>\n<td>\n<p>The fees should be paid by a bank transfer. In the case of late registration it is also possible to pay the late registration fee in cash at the tournament site during the registration..</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>JEDLO</h3>\n</td>\n<td>\n<h3>FOOD</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p><span style="color: #ff6600;"><strong>Večera piatok a sobota:</strong></span> <a href="http://www.dvorusedliaka.sk/">Dvor u Sedliaka</a> (bohat&yacute; v&yacute;ber slovenskej kuchyne), každ&yacute; si plat&iacute; svoje jedlo s&aacute;m.</p>\n</td>\n<td>\n<p><span style="color: #ff6600;"><strong>Dinner Friday and Saturday:</strong></span> <a href="http://www.dvorusedliaka.sk/">Dvor u Sedliaka</a> (great selection of Slovak cuisine)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><span style="color: #ff6600;"><strong>Obed sobota a nedeľa:</strong></span> moment&aacute;lne v &scaron;t&aacute;diu rie&scaron;enia. Ak sa nepodar&iacute; v sobotu zabezpečiť teply obed v priľahlej re&scaron;taur&aacute;cii pri ihrisku, zabezpeč&iacute;me don&aacute;&scaron;ku pizze na miesto ihriska (objedn&aacute;va sa pri registr&aacute;cii na mieste turnaja). V&nbsp;nedeľu sa bude dať objednať don&aacute;&scaron;ka pizze pred začiatkom tretieho kola.</p>\n</td>\n<td>\n<p><span style="color: #ff6600;"><strong>Lunch Saturday and Sunday:</strong></span> The Saturday lunch details are not finalized yet. If we won&rsquo;t be able to provide lunch at a restaurant next to the course we will organize pizza delivery directly to the course (with ordering on Saturday morning). On Sunday we will organize pizza delivery.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong><span style="color: #ff6600;">Raňajky:</span></strong> hr&aacute;či ubytovan&iacute; na z&aacute;mku Smolenice alebo v Penzi&oacute;ne pod Z&aacute;mkom si m&ocirc;žu objednať raňajky za 4 &euro;. Ak m&aacute;te z&aacute;ujem o raňajky, uveďte to v pozn&aacute;mke.</p>\n</td>\n<td>\n<p><span style="color: #ff6600;"><strong>Breakfast:</strong></span> players staying at Smolenice Castle and at Penzion pod Z&aacute;mkom can order breakfast for 4 &euro;. If you would like to order breakfast, indicate it in&nbsp; the note.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>UBYTOVANIE</h3>\n</td>\n<td>\n<h3>ACCOMMODATION</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Hr&aacute;či maj&uacute; niekoľko možnost&iacute; sa ubytovať</p>\n</td>\n<td>\n<p>Friday night: We are still working on it. Info here soon.</p>\n</td>\n</tr>\n<tr>\n<td>\n<h4>Možnosť 1 (Boler&aacute;z piatok - nedeľa)</h4>\n</td>\n<td>\n<h4>Option 1 (Boler&aacute;z, Friday - Sunday)</h4>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>piatok - nedeľa</strong> <a href="http://www.penzionpodzamkom.sk/index.php" target="_blank">Penzi&oacute;n pod Z&aacute;mkom, Boler&aacute;z </a>, <a href="http://goo.gl/maps/NKn9p">mapa</a></p>\n</td>\n<td>\n<p><strong>Friday - Sunday</strong> <a href="http://www.penzionpodzamkom.sk/index-eng.php" target="_blank">Penzi&oacute;n pod Z&aacute;mkom</a>, Boler&aacute;z, <a href="http://goo.gl/maps/NKn9p">map</a></p>\n</td>\n</tr>\n<tr>\n<td>ubytovanie 10 min&uacute;t / 8 km autom od ihriska, kapcita 39 l&ocirc;žok.Preferovan&uacute; <strong>veľkosť izby a preferovan&yacute;ch spolub&yacute;vaj&uacute;cich uveďte do pozn&aacute;mky</strong>, budeme sa snažiť zabezpečiť izbu podľa va&scaron;ich preferenci&iacute;.&nbsp; Veľkosť izby, žiaľ, negarantujeme vzhľadom na obmedzen&uacute; kapacitu.</td>\n<td>Accommodation 10 minutes / 8 km by car from the course, capacity: 39. Please,<strong> indicate the preferred room size and preferred roommate</strong>/roommates in the registration note we will try to accommodate your preferences the best way. Unfortunatelly, we cannot guarantee the size of your room due to the capacity restrictions.</td>\n</tr>\n<tr>\n<td>Jednol&ocirc;žkov&aacute; izba (1 osoba) 23,35&euro;/noc/izba</td>\n<td>Single room (1 person) 23,35&euro;/night/room</td>\n</tr>\n<tr>\n<td>Dvojl&ocirc;žkov&aacute; izba (2 osoby) 28,70&euro;/noc/izba</td>\n<td>Double room (2 persons) 28,70&euro;/night/room</td>\n</tr>\n<tr>\n<td>Trojl&ocirc;žkov&aacute; izba (3 osoby) 34,05&euro;/noc/izba</td>\n<td>Triple room (3 persons) 34,05&euro;/night/room</td>\n</tr>\n<tr>\n<td>&Scaron;tvorl&ocirc;žkov&aacute; izba (4 osoby) 40,40&euro;/noc/izba</td>\n<td>Quadruple room (4 persons) 40,40&euro;/night/room</td>\n</tr>\n<tr>\n<td>\n<h4>Možnosť 2 (Smolenice, sobota - nedeľa)</h4>\n</td>\n<td>\n<h3>Option 2 (Smolenice, Saturday - Sunday)</h3>\n</td>\n</tr>\n<tr>\n<td><strong>len jedna noc zo soboty na nedeľu</strong><br />\n<p><a href="http://www.smolenice.sav.sk/">Kongresov&eacute; centrum SAV Smolenice</a> - Smolenick&yacute; z&aacute;mok, priamo pri ihrisku</p>\n</td>\n<td>\n<p><strong>One night Saturday - Sunday only</strong></p>\n<p><a href="http://www.smolenice.sav.sk/">Congress Center of Slovak Academy of Sciences Smolenice</a> - Smolenice castle, at the DG course</p>\n</td>\n</tr>\n<tr>\n<td>ubytovanie na z&aacute;mku priamo na mieste turnaja, kapacita cca. 50 l&ocirc;žok, takmer v&yacute;lučne dvojl&ocirc;žkov&eacute; izby.&nbsp;<strong> Preferovan&uacute; veľkosť izby a preferovan&yacute;ch spolub&yacute;vaj&uacute;cich uveďte do pozn&aacute;mky</strong>,&nbsp;Budeme sa snažiť zabezpečiť izbu podľa va&scaron;ich preferenci&iacute; Veľkosť izby, žiaľ, negarantujeme vzhľadom na obmedzen&uacute; kapacitu.</td>\n<td>Accommodation in the castle directly at the tournament site! Capacity approx. 50 players. Almost exclusively double rooms. Please,<strong> indicate the preferred room size and preferred roommate</strong>/roommates in the registration note we will try to accommodate your preferences the best way. Unfortunatelly, we cannot guarantee the size of the room due to the capacity restrictions. <br /><br /></td>\n</tr>\n<tr>\n<td>\n<p>Dvojl&ocirc;žkov&aacute; izba (2 osoby) 60&euro;/noc/izba</p>\n</td>\n<td>\n<p>Double room (2 persons) 60&euro;/night/room</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Trojl&ocirc;žkov&aacute; izba (3 osoby) 72&euro;/noc/izba</p>\n</td>\n<td>\n<p>Triple room (3 persons) 72&euro;/night/room</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&Scaron;tvorl&ocirc;žkov&aacute; izba (4 osoby) 80&euro;/noc/izba</p>\n</td>\n<td>\n<p>Quad room (4 persons) 80&euro;/night/room</p>\n</td>\n</tr>\n<tr>\n<td>\n<h4>Možnosť 3 (kombin&aacute;cia)</h4>\n</td>\n<td>\n<h4>Option 3 (combination)</h4>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>piatok-sobota:</strong> Penzi&oacute;n pod Z&aacute;mkom</p>\n<p><strong>sobota - nedeľa:</strong> Z&aacute;mok Smolenice</p>\n</td>\n<td>\n<p><strong>Friday - Saturday</strong>: Penzi&oacute;n pod Z&aacute;mkom</p>\n<p><strong>Saturday - Sunday</strong>: Z&aacute;mok Smolenice</p>\n</td>\n</tr>\n<tr>\n<td>\n<h4>Možnosť 4 (vlastn&eacute; ubytovanie)</h4>\n</td>\n<td>\n<h4>Option 4 (on your own)</h4>\n</td>\n</tr>\n<tr>\n<td>Niiekoľko typov na ubytovanie v okol&iacute;</td>\n<td>A couple of tips for local accommodation in Smolenice</td>\n</tr>\n<tr>\n<td>\n<p><span style="font-size: small;"><strong><a href="http://www.penzionukumana.sk/?lang=en" target="_blank" rel="nofollow">Penzion U Kumana</a> $<br /><a href="http://www.steakhouse.szm.com/" target="_blank" rel="nofollow">Penzion Steak House Smolenice</a>&nbsp; $$</strong></span></p>\n<p><span style="font-size: small;"><strong><a href="http://www.penzion-agnes.sk/en/index.php" target="_blank" rel="nofollow">Penzion Villa Agnes</a> $$</strong></span></p>\n<p><span style="font-size: small;"><strong><a href="http://www.hotelsolmus.sk/" target="_blank" rel="nofollow">Garni Hotel Solmus</a> $$$ (asi zatvoren&eacute;)<br /></strong></span></p>\n</td>\n<td>\n<p><span style="font-size: small;"><strong><a href="http://www.penzionukumana.sk/?lang=en" target="_blank" rel="nofollow">Penzion U Kumana</a> $<br /><a href="http://www.steakhouse.szm.com/" target="_blank" rel="nofollow">Penzion Steak House Smolenice</a>&nbsp; $$</strong></span></p>\n<p><span style="font-size: small;"><strong><a href="http://www.penzion-agnes.sk/en/index.php" target="_blank" rel="nofollow">Penzion Villa Agnes</a> $$</strong></span></p>\n<p><span style="font-size: small;"><strong><a href="http://www.hotelsolmus.sk/" target="_blank" rel="nofollow">Garni Hotel Solmus</a> $$$ (very likely closed)<br /></strong></span></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Aj na Smolnickom z&aacute;mku aj v Penzi&oacute;ne pod Z&aacute;mkom je možnosť pre host&iacute; objednať si raňajky za 4&euro;/osoba/deň. Ak m&aacute;te o ne z&aacute;ujem, nap&iacute;&scaron;te to do pozn&aacute;mky.</p>\n</td>\n<td>\n<p>Both Smolenice Castle and Penzion pod Zamkom offer optional continental breakfast 4&euro;/person/day. If you are interested indicate it in the note.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Ubytovanie nie je potrebn&eacute; platiť vopred, plat&iacute; sa pri ubytov&aacute;van&iacute;.</p>\n</td>\n<td>\n<p>Accommodation fees are due at the time of check-in at the hotel.</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>PLATOBN&Eacute; &Uacute;DAJE</h3>\n</td>\n<td>\n<h3>BANK TRANSFER INFO</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong><span style="color: #ff6600;">IBAN:</span></strong> SK2084100000001100577143</p>\n</td>\n<td>\n<p><strong><span style="color: #ff6600;">IBAN:</span></strong> SK2084100000001100577143</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong><span style="color: #ff6600;">BIC/SWIFT:</span></strong> RIDBSKBX</p>\n</td>\n<td>\n<p><span style="color: #ff6600;"><strong>BIC/SWIFT:</strong></span> RIDBSKBX</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Meno: Richard Koll&aacute;r</p>\n</td>\n<td>\n<p>Account holder: Richard Koll&aacute;r</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>N&aacute;zov banky: ZUNO Bank AG</p>\n</td>\n<td>\n<p>Name of the bank: ZUNO Bank AG</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Adresa banky: Einsteinova 23<br /> 851 01 Bratislava, Slovensko</p>\n</td>\n<td>\n<p>Bank address: Einsteinova 23<br /> 851 01 Bratislava, Slovakia</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong><span style="color: #ff6600;">Pozn&aacute;mka: do pozn&aacute;mky uveďte va&scaron;e meno + preferencie ubytovania<br /></span></strong></p>\n</td>\n<td>\n<p><strong><span style="color: #ff6600;">Note: provide your name in the note to the recipient and your accommmodation preferences<br /></span></strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>LOK&Aacute;LNA DOPRAVA</h3>\n</td>\n<td>\n<h3>LOCAL TRANSPORTATION</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Ak potrebujete dopravu z Bratislavy do Smolen&iacute;c (cca. hodina cesty, 54 km) v piatok poobede alebo sobotu, uveďte to do pozn&aacute;mky, pok&uacute;sime sa v&aacute;m n&aacute;jsť odvoz na miesto turnaja a taktiež odvoz sp&auml;ť do Bratislavy po skončen&iacute; turnaja.</p>\n</td>\n<td>\n<p>If you need a transportation from Bratislava to Smolenice (approx. one hour travel, 54 km) on Friday afternoon or Saturday morning write it into the note. We will try to find you a ride to the tournament and also back from the tournament on Sunday afternoon.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Zahraničn&iacute;&nbsp; hr&aacute;či m&ocirc;žu letieť buď na letisko Bratislava (BTS) kam lieta niekoľko n&iacute;zkon&aacute;ladov&yacute;ch spolčnost&iacute; (napr. Ryanair z destin&aacute;cii: Dublin, London-Stansted, Bergamo, Birmingham, Liverpool, Luton, Rome, Brussels, Gerona, Bristol, Edinburgh, alebo Norwegian Air Shuttle z Osla, alebo tiež ČSA z Prahy).</p>\n</td>\n<td>\n<p>Foreign players may fly to Bratislava (BTS) airport that serves a couple of low-cost airlines (e.g. Ryanair destinations: Dublin, London-Stansted, Bergamo, Birmingham, Liverpool, Luton, Rome, Brussels, Gerona, Bristol, Edinburgh, or Norwegian Air Shuttle z Osla, or ČSA from Prague).</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Alternat&iacute;vne m&ocirc;žu hr&aacute;či letieť na letisko Viedeň (VIE), odkiaľ priamo do Bratislavy prem&aacute;vaj&uacute; počas cel&eacute;ho dňa autobusy cca. každ&uacute; pol hodinu, cena jednosmern&eacute;ho l&iacute;stka na autobus je cca. 7-8 Euro, cesta trv&aacute; cca. 1 hodinu. N&aacute;stupi&scaron;te autobusov je priamo pred pr&iacute;letov&yacute;m termin&aacute;lom.</p>\n</td>\n<td>\n<p>Alternatively, the players may fly to Vienna (VIE) airport. There are regular comfortable buses directly from the airport leaving approx. every 30 minutes, the price of a one-way ticket is around 7-8 Euro, the travel takes approx. one hour. The buses stop directly in front of the arrival terminal at the airport.</p>\n</td>\n</tr>\n<tr>\n<td>Z Bratislavy do Smolen&iacute;c id&uacute; počas piatku a soboty r&aacute;na autobusy. Spojenie si m&ocirc;žete vyhľadať na str&aacute;nke: <a href="http://cp.atlas.sk/vlak/spojenie/">http://cp.atlas.sk/vlak/spojenie/</a>. Smolenick&yacute; z&aacute;mok je cca. 7 min&uacute;t pe&scaron;i od zast&aacute;vky autobusu v Smoleniciach. Po pr&iacute;chode do Smolen&iacute;c po v&aacute;s v pr&iacute;pade potreby m&ocirc;žeme poslať auto, aby sme v&aacute;m uľahčili cestu.</td>\n<td>On Friday afternoon and on Saturday morning there are buses from Bratislava to Smolenice. A connection can be found using <a href="http://cp.atlas.sk/vlak/spojenie/">http://cp.atlas.sk/vlak/spojenie/</a> (select English in the lower right corner). Smolenice castle (and the course) is approx. 7 minutes walking distance from the bus stop (uphill). If you let us know we can wait for you at the bus stop to pick you up and provide a ride. In any case, let us know how you travel and we will try to help you as much as we can.&nbsp;</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<h3>S&Uacute;ŤAŽ V PUTTOVAN&Iacute;</h3>\n</td>\n<td>\n<h3>PUTTING CONTEST</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>V sobotu večer sa uskutočn&iacute; ofici&aacute;lna s&uacute;ťaž v puttovan&iacute; spoločne pre v&scaron;etk&yacute;ch hr&aacute;čov bez rozdielu pohlavia a kateg&oacute;rie. S&uacute;ťaž je bezplatn&aacute; a jej v&iacute;ťaz z&iacute;ska cenu 20&euro;. Hr&aacute;či, ktor&iacute; vypadn&uacute;, sa bud&uacute; m&ocirc;cť raz vyk&uacute;piť a pokračovať v s&uacute;ťaži za poplatok 3&euro;, o ktor&eacute; sa zv&yacute;&scaron;i cena pre celkov&eacute;ho v&iacute;ťaza.</p>\n</td>\n<td>\n<p>An official putting contest will be held on Saturday evening in one category regardless of the player&rsquo;s division. The entry to the competition is free for all registered players and the winner will be awarded a prize 20 &euro; in cash. Players who will be eliminated from the competition have an option to return back once to the contest for a fee 3&euro; that will be added to the total jackpot for the winner.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>TURNAJOV&Aacute; KOMISIA</h3>\n</td>\n<td>\n<h3>TOURNAMENTS ORGANIZERS</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Riaditeľ turnaja: Richard Koll&aacute;r</p>\n</td>\n<td>\n<p>Tournament director: Richard Koll&aacute;r</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>S&uacute;ťažn&aacute; komisia: Stefan Dobrev, Katka Boďov&aacute;</p>\n</td>\n<td>\n<p>Sport Commission: Stefan Dobrev, Katka Boďov&aacute;</p>\n</td>\n</tr>\n</tbody>\n</table>\n<h3><span style="color: #4c1130;"><br style="background-color: #38761d;" /><span style="color: #000000;">Mapa ihriska / Course Map</span><br /></span></h3>\n<p>&nbsp;</p>\n<div style="display: block; text-align: left;"><a href="https://sites.google.com/site/regnadgtur/smolenice-2013/smolenice.png?attredirects=0"><img src="https://sites.google.com/site/regnadgtur/_/rsrc/1367571144259/smolenice-2013/smolenice.png?height=221&amp;width=400" alt="" width="400" height="221" border="0" /></a></div>\n<h3>Na čo sa te&scaron;iť? / What to look for?<strong><br /></strong></h3>\n<p><span style="color: #4c1130;">&nbsp;</span></p>\n<div style="display: block; text-align: center; margin-right: auto; margin-left: auto;"><a href="https://sites.google.com/site/regnadgtur/smolenice-2013/discgolf4-miso-W480.jpg?attredirects=0"><img src="https://sites.google.com/site/regnadgtur/_/rsrc/1367575988196/smolenice-2013/discgolf4-miso-W480.jpg?height=300&amp;width=400" alt="" width="400" height="300" border="0" /></a></div>', 'a61258b0f6c1ad67ed3c1791e09e3651.jpg', 'a61258b0f6c1ad67ed3c1791e09e3651_thumb.jpg', 1, 48.514295, 17.431037, 100, 100, 1, 'Richard Kollár', 'rk.frisbee@gmail.com', '+421904146664'),
