(23, '2013 Hlohovec', '2013-05-18', '2013-05-18', 'Hlohovec', NULL, 50, 3, 1, '<p>2013 Hlohovec Open</p>', 'da58024c3fc29193d700f89ec7f422a3.jpg', 'da58024c3fc29193d700f89ec7f422a3_thumb.jpg', 0, NULL, NULL, 30, 30, 0, 'Martin Krička', 'cirsson@gmail.com', '09000000'),
