(25, '2013 Makov OPEN (MSR)', '2013-07-06', '2013-07-07', 'Makov', NULL, 72, 4, 1, '<p>2013 Makov OPEN (MSR)</p>', '8aaf1a9420c8facb9edebcf639be4f48.jpg', '8aaf1a9420c8facb9edebcf639be4f48_thumb.jpg', 0, NULL, NULL, 100, 100, 1, 'Lukáš Grožaj', 'kasho30@gmail.com', '09000000'),
(26, '2013 SK DG League Final', '2013-10-26', '2013-10-27', 'Kuchyňa, Malacky', NULL, 60, 5, 1, '<p>2013 Slovak Discgolf League Finals - first two rounds Kuchyňa, then three rounds Malacky</p>', '58cf08dd73fe703a8fa38396cdca106c.jpg', '58cf08dd73fe703a8fa38396cdca106c_thumb.jpg', 0, NULL, NULL, 100, 50, 0, 'Lukáš Grožaj', 'kasho30@gmail.com', '09000000');
INSERT INTO `statistics_tournaments` (`tournament_id`, `name`, `date`, `date_to`, `location`, `allowed_reg_categories`, `capacity`, `nmbr_of_round`, `nmbr_of_fnl_laps`, `about`, `photo`, `thumb`, `allow_registration`, `lat`, `lng`, `max_open`, `max_women`, `slovak_champ`, `dir_name`, `dir_email`, `dir_phone`) VALUES (27, '2014 Makov Open', '2014-07-04', '2014-07-06', 'Makov', ';OPEN;OPEN Junior;OPEN Master;WOMEN;WOMEN Junior;WOMEN Master', 48, 4, 1, '<p>If you have trouble with tournament registration, email us! Please be aware that if you first create your own account, the account must be approved by the administrator and only then you will be able to register for the tournament. You can always register without creating or using your account.</p>\n<table>\n<tbody>\n<tr>\n<td>\n<h3>V&scaron;eobecn&eacute; inform&aacute;cie</h3>\n</td>\n<td>\n<h3>General Info</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Pr&iacute;dte si znovu zahrať discgolf do Makova na Makov OPEN 2014. Len v Makove m&ocirc;žete pri drevenom kostol&iacute;ku hlboko v&nbsp;hor&aacute;ch, ďaleko od ciest, s v&yacute;hľadom na 8 pohor&iacute; na obzore puttovať na konci 250 metrovej jamky do kopca. Len v Makove si m&ocirc;žete vychutnať tak časť ihriska na kr&aacute;snych horsk&yacute;ch l&uacute;kach, v lese, ako aj na zjazdovke s ch&yacute;rnymi hodmi dole kopcom. Turnaj bude tento rok prv&yacute; raz zaraden&yacute; do ofici&aacute;lneho programu PDGA v kateg&oacute;rii C a&nbsp;z&aacute;roveň ako obyčajne aj ako turnaj kateg&oacute;rie A&nbsp;Slovenskej discgolfovej ligy. Ako obvykle poskytuje ubytovanie na vysokej &uacute;rovni v lyžiarskych apartm&aacute;noch SkiApartments Makov. Makov OPEN je jednoducho unik&aacute;tny discgolfov&yacute; turnaj so skvel&yacute;m n&aacute;ročn&yacute;m ihriskom, ktor&eacute; uspokoj&iacute; každ&eacute;ho hr&aacute;ča.</p>\n</td>\n<td>\n<p>Come again to play discgolf at Makov OPEN 2014. Only in Makov you can putt next to a wooden &nbsp; church deep in the countryside, far away from roads, with 8 mountain ranges in front of your eyes into a basket at the end of 250 meters uphill hole. Only in Makov you can enjoy a part of the course on hill&rsquo;s meadows, a part in the woods but also a part on the downhill slope with the famous downhill hole at the end. This year for the first time the tournament will be sanctioned as PDGA, category C, and as usual as Slovak Discgolf League, category A. Traditionally, comfortable accommodation will be provided at hosting SkiApartments Makov. Makov OPEN is simply a unique discgolf tourney with fantastic and difficult course which will satisfy every golfer&rsquo;s needs.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>Div&iacute;zie</h3>\n</td>\n<td>\n<h3>Divisions</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>OPEN (MPO), WOMEN (FPO), JUNIOR (MJ1, FJ1) (hr&aacute;či naroden&iacute; v roku 1995 a nesk&ocirc;r), MASTER (MPM, FPM) (hr&aacute;či naroden&iacute; v roku 1974 a sk&ocirc;r).</p>\n</td>\n<td>\n<p>OPEN (MPO), WOMEN (FPO), JUNIOR (MJ1, FJ1) (players born in 1995 and later), MASTER (MPM, FPM) (players born in 1974 and earlier).</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>Ihrisko/ Form&aacute;t</h3>\n</td>\n<td>\n<h3>Course / Format</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>V&scaron;etci hr&aacute;či hraj&uacute; 4 kol&aacute; po 12 jamiek (Gregu&scaron;e) &nbsp; a jedno kolo 7 jamiek (Zjazdovka). Okrem toho 10 fin&aacute;lov&yacute;ch jamiek (5 Gregu&scaron;e + 5 Zjazdovka) bude hrať najlep&scaron;&iacute;ch 5 MPO, 4 FPO, pr&iacute;padne 4 najlep&scaron;&iacute; v ostant&yacute;ch div&iacute;ziach, ak v nich bud&uacute; aspoň 4 s&uacute;ťažiaci.</p>\n</td>\n<td>\n<p>All players play 4 x 12 holes (Gregu&scaron;e course) and 1 x 7 holes (Downhill course). Additionally 10 final holes (5 on Gregu&scaron;e and 5 on Downhill) will be played by the best 5 players in MPO, the best 4 in FPO, and if at least 4 players register in an additional category, the best 4 from that category.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Ihrisko Gregu&scaron;e: 12 jamiek na horsk&yacute;ch l&uacute;kach, zv&auml;č&scaron;a mierne prev&yacute;&scaron;enie a&nbsp;dĺžka cca. 100 metrov, jedna veľmi dlh&aacute; jamka cca. 250 metrov.</p>\n</td>\n<td>\n<p>Course Gregu&scaron;e: 12 holes on mountain meadows with moderate elevation changes and average length 100m, one very long hole approx. 250m.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Ihrisko Zjazdovka: 5 jamiek dole svahom (jedna veľmi dlh&aacute;, cca. 190 metrov), 2 jamky v&nbsp;lese.</p>\n</td>\n<td>\n<p>Couse Zjazdovka: 5 holes downhill (one extra long approx. 190 meters), 2 holes in the woods.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>Program turnaja</h3>\n</td>\n<td>\n<h3>Tournament Schedule</h3>\n</td>\n</tr>\n<tr>\n<td>\n<h5>Piatok 4.7.2014</h5>\n</td>\n<td>\n<h5>Friday July 4, 2014</h5>\n</td>\n</tr>\n<tr>\n<td>\n<p>17:00 ihrisko je pripraven&eacute; na tr&eacute;ningov&uacute; hru</p>\n</td>\n<td>\n<p>17:00 the course is ready for a practice</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>20:30 hr&aacute;čske stretnutie</p>\n</td>\n<td>\n<p>20:30 player&rsquo;s meeting</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h5>Sobota 5.7.2014</h5>\n</td>\n<td>\n<h5>Saturday July 5, 2014</h5>\n</td>\n</tr>\n<tr>\n<td>\n<p>08:00 registr&aacute;cia oneskorencov</p>\n</td>\n<td>\n<p>08:00 late registration</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>08:30 kr&aacute;tke hr&aacute;čske stretnutie (Hotel)</p>\n</td>\n<td>\n<p>08:30 short player&rsquo;s meeting (Hotel)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>08:45 spoločn&yacute; odchod z&nbsp;hotela pe&scaron;o do kopca cca. 25 min&uacute;t k jamke č. 8 horn&eacute;ho ihriska Gregu&scaron;e a rozdelenie po jamk&aacute;ch.</p>\n</td>\n<td>\n<p>08:45 transfer to Hole #8 at Gregu&scaron;e course (approx. 25 min. moderate uphill walk), distribution of players to starting holes.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:30 začiatok spoločn&eacute;ho 1. a 2. kola (Gregu&scaron;e, 2 x 12 jamiek)</p>\n</td>\n<td>\n<p>09:30 start of the joint 1<sup>st</sup> and&nbsp;2<sup>nd</sup> round (Gregu&scaron;e, 2 x 12 holes)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>12:45 obed (priamo na ihrisku, bezlepkov&yacute; gul&aacute;&scaron;)</p>\n</td>\n<td>\n<p>12:45 lunch (at Gregu&scaron;e, gluten free goulash)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>14:00 začiatok 3. kola (Gregu&scaron;e, 12 jamiek) s pokračovan&iacute;m (Zjazdovka, 7 jamiek, odchod z&nbsp;Gregu&scaron;ov v&nbsp;intervaloch)</p>\n</td>\n<td>\n<p>14:00 start of the&nbsp;3<sup>rd</sup> round (Gregu&scaron;e, 12 holes) with the continuation (Downhill, 7 holes), interval start from Gregu&scaron;e</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>17:30 s&uacute;ťaž v&nbsp;hode do diaľky</p>\n</td>\n<td>\n<p>17:30 distance throw competition</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>18:30 večera</p>\n</td>\n<td>\n<p>18:30 dinner</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>20:30 s&uacute;ťaž v&nbsp;puttingu</p>\n</td>\n<td>\n<p>20:30 putting contest</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h5>Nedeľa 6.7.2014</h5>\n</td>\n<td>\n<h5>Sunday July 6, 2014</h5>\n</td>\n</tr>\n<tr>\n<td>\n<p>08:15 hr&aacute;čske stretnutie (Hotel)</p>\n</td>\n<td>\n<p>08:15 short player&rsquo;s meeting (Hotel)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>08:30 spoločn&yacute; odchod z&nbsp;hotela pe&scaron;o na Gregu&scaron;e</p>\n</td>\n<td>\n<p>08:30 transfer to Gregu&scaron;e (walk 25 min.)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:10 začiatok 4. kola (Gregu&scaron;e, 12 jamiek)</p>\n</td>\n<td>\n<p>09:10 start of 4<sup>th</sup> round (Gregu&scaron;e, 12 holes)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>11:30 such&yacute; obed (Gregu&scaron;e, rezeň s&nbsp;chlebom a&nbsp;uhorkou)</p>\n</td>\n<td>\n<p>11:30 box lunch (Gregu&scaron;e, schnitzel and bread, pickles)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>12:10 fin&aacute;lov&eacute; kolo (9 jamiek, Gregu&scaron;e 5 holes, Zjazdovka 4 holes)</p>\n</td>\n<td>\n<p>12:10 final round (9 holes, Gregu&scaron;e 5 holes, Downhill 4 holes)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>14:30 vyhodnotenie pr&iacute;p. obed v&nbsp;hoteli</p>\n</td>\n<td>\n<p>14:30 awards ceremony, optional lunch</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Časy začiatkov 2., 3. a&nbsp;fin&aacute;lov&eacute;ho kola a&nbsp;čas obeda s&uacute; len orientačn&eacute;.</p>\n</td>\n<td>\n<p>The start time of the 2<sup>nd</sup>, 3<sup>rd</sup> and final rounds, and lunch time are only approximate.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>Turnajov&eacute; poplatky</h3>\n</td>\n<td>\n<h3>Tournament Fees</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>V&scaron;etky poplatky sa platia až na mieste na recepcii hotela, okrem jednodňov&yacute;ch poplatkov, ktor&eacute; sa platia organiz&aacute;torom turnaja.</p>\n</td>\n<td>\n<p>All fees are to be paid at the hotel registration desk, except one day fees that are to be paid directly to the tournament organizers during the on-site registration.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>40 &euro; &ndash;turnajov&yacute; poplatok vr&aacute;tane stravy (2 x obed, večera) a&nbsp;nocľahu zo soboty na nedeľu.</p>\n</td>\n<td>\n<p>40 &euro; &ndash; tournament fee including food (2 x lunch, 1 x dinner) and Saturday night at the hotel.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>19 &euro; &ndash; poplatok za &uacute;časť na turnaji len v&nbsp;jeden deň (bez ubytovania).</p>\n</td>\n<td>\n<p>19 &euro; &ndash; one day tournament fee (no accommodation).</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>2 &euro; &ndash; zľava pre členov SAF a&nbsp;PDGA.</p>\n</td>\n<td>\n<p>2 &euro; &ndash; discount for SAF and PDGA members.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>&Scaron;trukt&uacute;ra poplatkov</h3>\n</td>\n<td>\n<h3>Fee Structure</h3>\n</td>\n</tr>\n<tr>\n<td>\n<h5>Cel&yacute; turnaj</h5>\n</td>\n<td>\n<h5>Full Registration</h5>\n</td>\n</tr>\n<tr>\n<td>\n<p>14 &euro; &ndash; ubytovanie zo soboty na nedeľu</p>\n</td>\n<td>\n<p>14 &euro; - Saturday night at the hotel</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>11 &euro; &ndash; 2 x obed na ihrisku + večera (extra požiadavka na jedlo za pr&iacute;platok)</p>\n</td>\n<td>\n<p>11 &euro; - 2 x lunch at the course + Saturday dinner (special order of food is subject to extra fee)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>15 &euro; &ndash; turnajov&yacute; poplatok</p>\n</td>\n<td>\n<p>15 &euro;<strong> - </strong>tournament fee</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Spolu 40 &euro; (2 &euro; zľava pre členov SAF a&nbsp;PDGA)</p>\n</td>\n<td>\n<p>Together 40 &euro; (2 &euro; discount for SAF and PDGA)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h5>Jednodňov&yacute; poplatok</h5>\n</td>\n<td>\n<h5>One Day Registration</h5>\n</td>\n</tr>\n<tr>\n<td>\n<p>4 &euro; &ndash; obed na ihrisku</p>\n</td>\n<td>\n<p>4 &euro; - lunch at the course</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>15 &euro; &ndash; turnajov&yacute; poplatok</p>\n</td>\n<td>\n<p>15 &euro; - tournament fee</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Spolu 19 &euro; (2 &euro; zľava pre členov SAF a&nbsp;PDGA)</p>\n</td>\n<td>\n<p>Together 19 &euro; (2&euro; discount for SAF and PDGA)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h5>Doplnkov&eacute; služby</h5>\n</td>\n<td>\n<h5>Additional Optional Services</h5>\n</td>\n</tr>\n<tr>\n<td>\n<p>4 &euro; - raňajky sobota</p>\n</td>\n<td>\n<p>4 &euro; - breakfast Saturday</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>4 &euro; - raňajky nedeľa</p>\n</td>\n<td>\n<p>4 &euro; - breakfast Sunday</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>14 &euro; - ubytovanie z&nbsp;piatku na sobotu</p>\n</td>\n<td>\n<p>14 &euro; - hotel accommodation Fri/Sat night</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>Registr&aacute;cia</h3>\n</td>\n<td>\n<h3>Registration</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Registr&aacute;cia na tejto str&aacute;nke bude otvoren&aacute; od 16.5.2014 o&nbsp;14:00 do 3.7.2014. Ak to umožn&iacute; turnajov&aacute; kapacita, bude sa možn&eacute; registrovať aj priamo na turnaji.</p>\n</td>\n<td>\n<p>Registration will open on May 16<sup>th</sup> 2014 at 14:00 on this website and will close on July 3<sup>rd</sup> 2014. If the tournament capacity allows a late on-site registration will be available.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Pri registr&aacute;cii maj&uacute; prednosť hr&aacute;či, ktor&iacute; sa registruj&uacute; na cel&yacute; turnaj, hr&aacute;či registrovan&iacute; iba na jeden deň bud&uacute; m&ocirc;cť &scaron;tartovať iba ak to kapacita turnaja umožn&iacute;.</p>\n</td>\n<td>\n<p>The players registered for the full tournament will be preferred and only if the capacity of the tournament will allow it one day registrations will be possible.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>Ubytovanie</h3>\n</td>\n<td>\n<h3>Accommodation</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Ubytovanie v&nbsp;luxusn&yacute;ch <a href="http://www.makovapartmany.sk/?page_id=1142">SkiApartments Makov</a> (v dvojposteľov&yacute;ch a trojposteľov&yacute;ch apartm&aacute;noch)je s&uacute;časťou hr&aacute;čskeho poplatku. Hotel poskytuje aj wellness služby a priamy pr&iacute;stup na ihrisko.</p>\n</td>\n<td>\n<p>Accommodation for all players is included in the player&rsquo;s fee at luxurious <a href="http://www.makovapartmany.sk/?page_id=1142">SkiApartments Makov</a> (double and triple apartments) with wellness services and direct access to the course.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Ak chcete zdieľať izbu s inou konkr&eacute;tnou osobou nap&iacute;&scaron;te to do pozn&aacute;mky v online registrčnom formul&aacute;ri. Pam&auml;tajte, že nevieme garantovať presn&uacute; veľkosť izby (dvojka/trojka).</p>\n</td>\n<td>\n<p>If you want to share a room with a particular player indicate it in the note during online registration. Keep in mind that we cannot guarantee the exact size of the room (double/triple).</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>V&scaron;etci hr&aacute;či si musia do hotela priniesť prez&uacute;vky a&nbsp;nosiť ich cel&yacute; čas vo vn&uacute;tri!</p>\n</td>\n<td>\n<p>Bring slippers, all players need to wear slippers or other indoor shoes at all time in the hotel!</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Ak chcete &scaron;tartovať na turnaji bez ubytovania, registrujte sa a&nbsp;ihneď n&aacute;s kontaktujte emailom.</p>\n</td>\n<td>\n<p>If you want to play at the tournament and do not need accommodation register online and contact us immediately by email.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>Jedlo</h3>\n</td>\n<td>\n<h3>Food</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Obed v&nbsp;sobotu a&nbsp;v&nbsp;nedeľu a&nbsp;večera v&nbsp;sobotu s&uacute; s&uacute;časťou turnajov&eacute;ho poplatku. Raňajky v&nbsp;obidva dni si možno priobjednať na mieste v&nbsp;hoteli. Hotel m&aacute; plne funkčn&uacute; re&scaron;taur&aacute;ciu a&nbsp;bar, kde si možno jedlo a&nbsp;n&aacute;poje objednať z&nbsp;jed&aacute;lneho l&iacute;stku.</p>\n</td>\n<td>\n<p>The lunch on Saturday and Sunday is included in the player&rsquo;s fee. Breakfast can be ordered at the hotel. There is a restaurant and a bar at the hotel where you can order food and drinks a la carte.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>Turnajov&aacute; komisia</h3>\n</td>\n<td>\n<h3>Competition Committee</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Katka Boďov&aacute;, Stefan Dobrev, Martin Krička</p>\n</td>\n<td>\n<p>Katka Boďov&aacute;, Stefan Dobrev, Martin Krička</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>Riaditeľ turnaja</h3>\n</td>\n<td>\n<h3>Tournament Director</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Richard Koll&aacute;r, rk.frisbee...at...gmail,</p>\n<p>+421&nbsp;904&nbsp;146 664</p>\n</td>\n<td>\n<p>Richard Koll&aacute;r, rk.frisbee...at...gmail,</p>\n<p>+421&nbsp;904&nbsp;146 664</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<h3>Video from 2013</h3>\n<p><iframe src="http://www.youtube.com/embed/jM3ZUsNuhcE" width="525" height="350"></iframe></p>\n<h3>Video from 2012</h3>\n<p><iframe src="http://www.youtube.com/embed/donoRtEFwKU" width="525" height="350"></iframe></p>\n<h3>Video from 2011</h3>\n<p><iframe src="http://www.youtube.com/embed/Kdbz3T7w0_U" width="525" height="350"></iframe></p>', '8c752aac9f6289cadc9b0ae5f869cc24.jpg', '8c752aac9f6289cadc9b0ae5f869cc24_thumb.jpg', 1, 49.349954, 18.474323, 100, 100, 0, 'Richard Kollár', 'rk.frisbee@gmail.com', '00421904146664'),
(28, '2014 Hlohovec Open', '2014-04-06', '2014-04-06', 'Hlohovec', ';OPEN;OPEN Junior;WOMEN;WOMEN Junior', 52, 3, 1, '<table>\n<tbody>\n<tr>\n<td>\n<h3>KDE</h3>\n</td>\n<td>\n<h3>WHERE</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>V okol&iacute; <a href="https://www.google.com/maps/@48.4229958,17.7882525,773m/data=!3m1!1e3!4m2!6m1!1szi2yeNqBPPxQ.k9qbOlPeehZE">Hlohoveck&eacute;ho parku</a></p>\n</td>\n<td>\n<p>Park <a href="https://maps.google.sk/maps?q=48.423348,17.787033&amp;hl=sk&amp;num=1&amp;t=h&amp;z=16">Hlohovec</a></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>DIV&Iacute;ZIE</h3>\n</td>\n<td>\n<h3>DIVISIONS</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>OPEN, WOMEN, JUNIOR OPEN, JUNIOR WOMEN</p>\n</td>\n<td>\n<p>OPEN, WOMEN, JUNIOR OPEN, JUNIOR WOMEN</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>IHRISKO / FORM&Aacute;T</h3>\n</td>\n<td>\n<h3>COURSE / FORMAT</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>3 x 13 jamiek + 6 jamiek fin&aacute;le (najlep&scaron;&iacute;ch 5 OPEN, najlep&scaron;ie 4 WOMEN)</p>\n</td>\n<td>\n<p>3 x 13 holes + 6 holes final (best 5 OPEN, best 4 WOMEN)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>V&auml;č&scaron;ina jamiek je v parkovom prostred&iacute; medzi stromami, zv&auml;č&scaron;a rovn&yacute; ter&eacute;n</p>\n</td>\n<td>\n<p>Most of the holes in a open park space with trees, typically flat terrain</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>&nbsp;</p>\n</td>\n<td>\n<p>&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>PROGRAM TURNAJA</h3>\n</td>\n<td>\n<h3>TOURNAMENT SCHEDULE</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:00 &ndash; 09:30 registr&aacute;cia hr&aacute;čov</p>\n</td>\n<td>\n<p>09:00 &ndash; 09:30 registration</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:30 &ndash; 09:45 stretnutie hr&aacute;čov</p>\n</td>\n<td>\n<p>09:30 &ndash; 09:45 player&rsquo;s meeting</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>10:00 &ndash; 12:45 prv&eacute; a druh&eacute; kolo (2 x 13 jamiek)</p>\n</td>\n<td>\n<p