INSERT INTO `statistics_tournaments` (`tournament_id`, `name`, `date`, `date_to`, `location`, `allowed_reg_categories`, `capacity`, `nmbr_of_round`, `nmbr_of_fnl_laps`, `about`, `photo`, `thumb`, `allow_registration`, `lat`, `lng`, `max_open`, `max_women`, `slovak_champ`, `dir_name`, `dir_email`, `dir_phone`) VALUES (30, '2014 Trnava OPEN', '2014-05-17', '2014-05-17', 'Trnava', ';OPEN;OPEN Junior;WOMEN', 45, 3, 1, '<p>&nbsp;</p>\n<table>\n<tbody>\n<tr>\n<td>\n<h3>KDE</h3>\n</td>\n<td>\n<h3>WHERE</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>V Trnave, parkovanie pri OC Kaufland, ulica Vl. Celementisa mapa: <a href="https://goo.gl/maps/8ZnCF">OC Kaufland &ndash; stretnutie hr&aacute;čov pri TP č. 1</a></p>\n</td>\n<td>\n<p>Trnava, parking close to the Shopping Center Kaufland: <a href="https://goo.gl/maps/8ZnCF">OC Kaufland - meeting point at TP no. 1</a></p>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<p><strong>&nbsp;</strong></p>\n</td>\n<td>\n<p><strong>&nbsp;</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>DIV&Iacute;ZIE</h3>\n</td>\n<td>\n<h3>DIVISIONS</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>OPEN, WOMEN, OPEN JUNIOR</p>\n</td>\n<td>\n<p>OPEN, WOMEN, OPEN JUNIOR</p>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<p><strong>&nbsp;</strong></p>\n</td>\n<td>\n<p><strong>&nbsp;</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>IHRISKO / FORM&Aacute;T</h3>\n</td>\n<td>\n<h3>COURSE / FORMAT</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>3 x 12 jamiek + 6 jamiek fin&aacute;le (najlep&scaron;&iacute;ch 5 OPEN, najlep&scaron;ie 4 WOMEN)</p>\n</td>\n<td>\n<p>3 x 12 holes + 6 holes final (best 5 OPEN, best 4 WOMEN)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>V&auml;č&scaron;ina jamiek je v parkovom prostred&iacute; medzi stromami, zv&auml;č&scaron;a rovn&yacute; ter&eacute;n.</p>\n</td>\n<td>\n<p>Most of the holes are in an open park space with trees, typically flat terrain.</p>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<h3>PROGRAM TURNAJA</h3>\n</td>\n<td>\n<h3>TOURNAMENT SCHEDULE</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>08:30 &ndash; 08:45 discgolfov&aacute; klinika pre začiatočn&iacute;kov &ndash; vysvetl&iacute;me z&aacute;klady hry</p>\n</td>\n<td>\n<p>08:30 &ndash; 08:45 discgolf clinic for beginners</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>08:45 &ndash; 09:00 registr&aacute;cia hr&aacute;čov pri jamke č. 1</p>\n</td>\n<td>\n<p>08:45 &ndash; 09:00 registration (Teepad no. 1)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:00 &ndash; 09:15 stretnutie hr&aacute;čov</p>\n</td>\n<td>\n<p>09:00 &ndash; 09:15 player&rsquo;s meeting</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>09:30 &ndash; 12:00 prv&eacute; a druh&eacute; kolo (2 x 12 jamiek)</p>\n</td>\n<td>\n<p>09:30 &ndash; 12:00 1<sup>st</sup> and 2<sup>nd</sup> round (2 x 12 holes)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>12:00 &ndash; 13:00 obedn&aacute; prest&aacute;vka</p>\n</td>\n<td>\n<p>12:00 &ndash; 13:00 lunch break</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>13:00 &ndash; 13:15 stretnutie hr&aacute;čov pri jamke č.1</p>\n</td>\n<td>\n<p>13:00 &ndash; 13:15 player&rsquo;s meeting (Teepad no. 1)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>13:30 &ndash; 15:00 tretie kolo (1 x 12 jamiek)</p>\n</td>\n<td>\n<p>13:30 &ndash; 15:00 3<sup>rd</sup> round (1 x 12 holes)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>15:00 &ndash; 15:15 hr&aacute;čske stretnutie</p>\n</td>\n<td>\n<p>15:00 &ndash; 15:15 player&rsquo;s meeting</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>15:30 &ndash; 16:00 fin&aacute;le (1 x 6 jamiek)</p>\n</td>\n<td>\n<p>15:30 &ndash; 16:00 final round (1 x 6 holes)</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>16:15 &ndash; 16:30 vyhodnotenie</p>\n</td>\n<td>\n<p>16:15 &ndash; 16:30 awards ceremony</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>&nbsp;</strong></p>\n</td>\n<td>\n<p><strong>&nbsp;</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>REGISTR&Aacute;CIA</h3>\n</td>\n<td>\n<h3>REGISTRATION</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Na tejto str&aacute;nke do 14.5.2014, pr&iacute;padne priamo na turnaji počas registr&aacute;cie</p>\n</td>\n<td>\n<p>On this website until May 14, 2014 or directly at the tournament registration booth.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>&nbsp;</strong></p>\n</td>\n<td>\n<p><strong>&nbsp;</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>REGISTRAČN&Yacute; POPLATOK</h3>\n</td>\n<td>\n<h3>REGISTRATION FEE</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>5 Euro na hr&aacute;ča</p>\n</td>\n<td>\n<p>5 Euro per player</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>1 Euro zľava pre členov Slovenskej asoci&aacute;cie Frisbee</p>\n</td>\n<td>\n<p>1 Euro discount for members of Slovak Association of Frisbee</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Poplatok sa plat&iacute; pri registr&aacute;cii priamo na turnaji.</p>\n</td>\n<td>\n<p>The registration fee is due at the tournament registration booth.</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>&nbsp;</strong></p>\n</td>\n<td>\n<p><strong>&nbsp;</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<h3>JEDLO</h3>\n</td>\n<td>\n<h3>FOOD</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p>Na vlastn&eacute; n&aacute;klady. Baget&eacute;ria v Kauflande, fast foody v Tescu (iba 7 min&uacute;t ch&ocirc;dze od ihriska).</p>\n</td>\n<td>\n<p>At your own costs. Sandwich shop in Kaufland, a few fast food restaurants in Tesco (7 minutes walk from the course)</p>\n</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td>&nbsp;</td>\n</tr>\n<tr>\n<td>\n<h3>TURNAJOV&Aacute; KOMISIA</h3>\n</td>\n<td>\n<h3>TOURNAMENTS ORGANIZERS</h3>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>Riaditeľ turnaja:</strong> Roman Miezga</p>\n</td>\n<td>\n<p><strong>Tournament director:</strong> Roman Miezga</p>\n</td>\n</tr>\n<tr>\n<td>\n<p><strong>S&uacute;ťažn&aacute; komisia:</strong> Martin Krička, Richard Koll&aacute;r</p>\n</td>\n<td>\n<p><strong>Sport Commission:</strong> Martin Krička, Richard Koll&aacute;r</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>', '33a3a259c158e947445e9331c1b6c747.JPG', '33a3a259c158e947445e9331c1b6c747_thumb.JPG', 1, 48.381865, 17.599848, 50, 50, 0, 'Roman Miezga', 'r.miezga@discline.com', '00421335334614');
